INSERT INTO `about` (`id`, `text_top`, `judul`, `konten`, `tipe`, `created_at`, `updated_at`) VALUES
(1, '<p style=\"margin-left:5%;margin-right:5%;\">Melalui perjalanan panjang sejarah yang telah dilalui, Bank BPR Jatim Bank UMKM Jawa Timur selalu berkomitmen memberikan kontribusi terbaik guna membangun masyarakat Jawa Timur melalui berbagai produk layanan terbaik.</p>', 'Sejarah', '<p style=\"text-align:justify; text-justify:inter-word;\">Berawal saat Pemerintah Jawa Timur mengeluarkan kebijakan di bidang perkreditan guna mendorong pengembangan usaha kecil, dengan membentuk Kredit Pedesaan yang disebut Kredit Usaha Rakyat Kecil (KURK). Pilot project yang semula hanya dilaksanakan di wilayah Madura pada tahun 1984/1985 diperluas ke seluruh Jawa Timur dengan SK No. 197 tahun 1984, kemudian status kelembagaannya   di perjelas sebagai BUMD dengan Perda Prov. Jatim No. 5 tahun 1987 dan mulai tahun 1988/1989 melalui beberapa tahapan konsolidasi LKURK telah menjadi 222 unit di 37 Kabupaten/kota se Jawa Timur.</p>\r\n        <p style=\"text-align:justify; text-justify:inter-word;\">Dengan berlakunya undang-undang No.7 tahun 1992 maka sesuai ketentuan pasal 58 bahwa Lembaga Kredit Usaha Rakyat Kecil (KURK), diberikan status sebagai Bank Perkreditan Rakyat dengan memenuhi persyaratan tata cara yang ditetapkan dengan peraturan Pemerintah. </p>\r\n        <p style=\"text-align:justify; text-justify:inter-word;\">Diantara 222 unit Lembaga Kredit Usaha Rakyat Kecil Jawa Timur (LKURK)setelah melalui beberapa penyaringan dan penelitian oleh Bank Indoensia dikukuhkan menjadi 66 unit PD. BPR KURK JATIM dengan Perda No. 16 tahun 1994.</p>\r\n        <p style=\"text-align:justify; text-justify:inter-word;\">Sesuai surat keputusan Bank Indonesia Nomor : 32/52/Kep/Dir tanggal 14 Mei 1999 tentang persyaratan dan tata cara merger, konsolidasi, dan akuisisi Bank Perkreditan Rakyat, dan sekaligus untuk menumbuhkan brand image masyarakat maka terhadap 66 unit PR. BPR KURK JATIM direncanakan dilakukan konsolidasi menjadi Perseroan Terbatas Bank Perkreditan Rakyat Jawa Timur atau yang lebih dikenal dengan Bank BPR Jatim.\r\n        Konsolidasi PD. BPR JATIM menjadi Bank BPR Jatim bertujuan agar dapat tumbuh sehat, kuat, serta bekerja lebih berdaya guna dan berhasil guna sehingga mampu memberikan pelayanan kepada masyrakat secara profesional.</p>', 'sejarah', '2021-07-27 14:11:20', '2021-07-27 14:11:20'),
(2, '<p style=\"margin-left:5%;margin-right:5%;\">Melalui perjalanan panjang sejarah yang telah dilalui, Bank BPR Jatim Bank UMKM Jawa Timur selalu berkomitmen memberikan kontribusi terbaik guna membangun masyarakat Jawa Timur melalui berbagai produk layanan terbaik.</p>', 'Visi dan Misi', '<p>				\r\n        Menjadi Bank yang sehat <br /> dan berkembang secara wajar, didukung oleh SDM  <br /> yang profesional dan berintegritas tinggi <br />serta fokus di UMKMK.</p><br><p>Ikut berperan dalam perekonomian Jawa Timur\r\n        melalui pengembangan UMKMK\r\n        (Usaha Mikro, Kecil, Menengah, Koperasi)\r\n        utamanya Sektor Pertanian dan Sektor Perekonomian lainnya serta meningkatkan layanan berbasis digital.</p><br><p>Mitra UMKM\r\n        terpercaya.</p>', 'visi-misi', '2021-07-27 14:11:20', '2021-07-27 14:11:20'),
(3, '<p style=\"margin-left:5%;margin-right:5%;\">Melalui perjalanan panjang sejarah yang telah dilalui, Bank BPR Jatim Bank UMKM Jawa Timur selalu berkomitmen memberikan kontribusi terbaik guna membangun masyarakat Jawa Timur melalui berbagai produk layanan terbaik.</p>', 'Peranan', '<p>				\r\n        Mendukung pengentasan kemiskinan yang harus dilakukan oleh Pemerintah Provinsi Kabupaten/kota.</p><br><p>Mendukung penciptaan lapangan kerja sehingga mengurangi pengangguran.</p><br><p>Mendukung pertumbuhan ekonomi daerah.</p>', 'peranan', '2021-07-27 14:11:20', '2021-07-27 14:11:20'),
(4, '<p style=\"margin-left:5%;margin-right:5%;\">Melalui perjalanan panjang sejarah yang telah dilalui, Bank BPR Jatim Bank UMKM Jawa Timur selalu berkomitmen memberikan kontribusi terbaik guna membangun masyarakat Jawa Timur melalui berbagai produk layanan terbaik.</p>', 'Struktur Organisasi', '<h3>STRUKTUR ORGANISASI KANTOR PUSAT</h3>', 'stuktur', '2021-07-27 14:11:20', '2021-07-27 14:11:20'),
(5, '<p style=\"margin-left:5%;margin-right:5%;\">Melalui perjalanan panjang sejarah yang telah dilalui, Bank BPR Jatim Bank UMKM Jawa Timur selalu berkomitmen memberikan kontribusi terbaik guna membangun masyarakat Jawa Timur melalui berbagai produk layanan terbaik.</p>', 'Manajemen', '<h3>Manajemen</h3>', 'manajemen', '2021-07-27 14:11:20', '2021-07-27 14:11:20'),
(6, '<p style=\"margin-left:5%;margin-right:5%;\">Melalui perjalanan panjang sejarah yang telah dilalui, Bank BPR Jatim Bank UMKM Jawa Timur selalu berkomitmen memberikan kontribusi terbaik guna membangun masyarakat Jawa Timur melalui berbagai produk layanan terbaik.</p>', 'Identitas Perusahaan', '<h3>Identitas Perusahaan</h3>', 'identitas', '2021-07-27 14:11:20', '2021-07-27 14:11:20'),
(7, '<p style=\"margin-left:5%;margin-right:5%;\">Bank BPR Jatim Bank UMKM Jawa Timur sebagai perusahaan terbuka memiliki kewajiban untuk melakukan keterbukaan dan transparansi informasi laporan kinerja kepada pihak investor, masyarakat pasar modal, dan pemegang saham.</p>', 'Hukum Perusahaan', '<h3>Hukum Perusahaan</h3>', 'hukum', '2021-07-27 14:11:20', '2021-07-27 14:11:20'),
(8, '<p style=\"margin-left:5%;margin-right:5%;\">Bank BPR Jatim Bank UMKM Jawa Timur sebagai perusahaan terbuka memiliki kewajiban untuk melakukan keterbukaan dan transparansi informasi laporan kinerja kepada pihak investor, masyarakat pasar modal, dan pemegang saham.</p>', 'Komposisi Saham', '<h3>Komposisi Saham</h3>', 'komposisi', '2021-07-27 14:11:20', '2021-07-27 14:11:20'),
(9, '<p style=\"margin-left:5%;margin-right:5%;\">Bank BPR Jatim Bank UMKM Jawa Timur sebagai perusahaan terbuka memiliki kewajiban untuk melakukan keterbukaan dan transparansi informasi laporan kinerja kepada pihak investor, masyarakat pasar modal, dan pemegang saham.</p>', 'Tata Kelola Perusahaan', '<h3>Tata Kelola Perusahaan</h3>', 'tata_kelola', '2021-07-27 14:11:20', '2021-07-27 14:11:20');

