INSERT INTO `item_produk_layanan` (`id`, `id_jenis`, `judul`, `cover`, `slug`, `text_top`, `konten`, `created_at`, `updated_at`) VALUES
(1, 1, 'Tambun', 'public/upload/produk-layanan/20210728163642TAMBUN_2018-11-01_04_57_01.jpg', 'tambun', 'Merupakan salah satu produk Tabungan Bank BPR Jatim yang memiliki kelebihan dalam hal kemudahan bertransaksi dengan menggunakan bumbung.', , '2021-07-28 09:36:42', '2021-07-28 09:48:23'),
(2, 1, 'SIKEMAS', 'public/upload/produk-layanan/20210728163722SIKEMAS_2018-11-01_04_59_13.jpg', 'sikemas', 'Merupakan salah satu produk Tabungan Bank BPR Jatim yang paling dikenal masyarakat. Memiliki suku bunga bersaing dan memberikan kemudahan dan kenyamanan karena terkoneksi dengan fasilitas ATM Bank BPR Jatim.', , '2021-07-28 09:37:22', '2021-07-28 09:48:08'),
(3, 1, 'SIMPEL', 'public/upload/produk-layanan/20210728191544SIMPEL_2018-11-01_05_01_53.jpg', 'simpel', 'Merupakan salah satu produk Tabungan Bank BPR Jatim bekerjasama dengan OJK (Otoritas Jasa Keuangan), diterbitkan secara Nasional oleh Bank-Bank diseluruh Indonesia. Tabungan ini dikhususkan bagi Pelajar sebagai bentuk edukasi dan inklusi keuangan untuk mendorong budaya menabung sejak dini.', , '2021-07-28 12:15:44', '2021-07-28 12:15:44'),
(4, 1, 'DEPOSITO ON CALL', 'public/upload/produk-layanan/20210728191618DEPOSITO ON CALL_2018-11-01_05_02_39.jpg', 'deposito-on-call', 'Merupakan salah satu produk Deposito Bank BPR Jatim yang memastikan uang diinvestasikan ditempat yang aman dan terpercaya sekaligus menguntungkan. Tersedia beberapa pilihan jangka waktu yang dapat ditentukan sesuai kebutuhan, yaitu 7, 14 atau 21 hari dengan fasilitas Automatic Roll Over (ARO).', , '2021-07-28 12:16:18', '2021-07-28 12:16:18'),
(5, 1, 'DEPOSITO KELUARGA', 'public/upload/produk-layanan/20210728191705DEPOSITO KELUARGA_2018-11-01_05_16_25.jpg', 'deposito-keluarga', 'Merupakan salah satu produk Deposito Bank BPR Jatim yang memiliki bunga kompetitif. Deposito ini dikhususkan bagi keluarga dari karyawan/ karyawati Bank BPR Jatim.', , '2021-07-28 12:17:05', '2021-07-28 12:17:05'),
(6, 1, 'DEPOSITO BERJANGKA', 'public/upload/produk-layanan/20210728191745DEPOSITO BERJANGKA_2018-11-01_05_06_09.jpg', 'deposito-berjangka', 'Merupakan salah satu produk Deposito Bank BPR Jatim yang memastikan uang diinvestasikan ditempat yang aman dan terpercaya sekaligus menguntungkan. Tersedia beberapa pilihan jangka waktu yang dapat ditentukan sesuai kebutuhan, yaitu 1, 3, 6, 12 atau 24 bulan dengan fasilitas Automatic Roll Over (ARO)', , '2021-07-28 12:17:45', '2021-07-28 12:17:45'),
(7, 1, 'SIKEMAS BERHADIAH LANGSUNG', 'public/upload/produk-layanan/20210728191830SIKEMAS BERHADIAH LANGSUNG_2019-05-22_14_27_40.jpg', 'sikemas-berhadiah-langsung', 'Merupakan produk baru Tabungan Berhadiah Langsung Bank BPR Jatim yang paling di gemari masyarakat. Berhadiah langsung tanpa diundi. Hadiah dapat memilih berdasarkan nominal penempatan dana dan jangka waktu yang telah ditentukan. Memiliki suku bunga bersaing. Berlaku untuk nasabah baru perorangan dan non perorangan.', , '2021-07-28 12:18:30', '2021-07-28 12:18:30'),
(8, 2, 'KUSUMA', 'public/upload/produk-layanan/20210728192030KUSUMA_2018-11-01_05_07_30.jpg', 'kusuma', 'Kusuma adalah Kredit Untuk Semua Usaha Masyarakat.', , '2021-07-28 12:20:30', '2021-07-28 12:20:30'),
(9, 2, 'KRIDA MAS', 'public/upload/produk-layanan/20230515084424cover kredit website-09.png', 'krida-mas', 'Krida Mas Adalah fasilitas kredit yang diberikan kepada masyarakat dengan jaminan emas. Keunggulan kredit ini adalah proses yang cepat, kredit cair dalam waktu 10 menit dan dilengkapi dengan mobil kas keliling.', , '2021-07-28 12:21:16', '2023-05-15 08:44:24');
INSERT INTO `item_produk_layanan` (`id`, `id_jenis`, `judul`, `cover`, `slug`, `text_top`, `konten`, `created_at`, `updated_at`) VALUES
(10, 2, 'MULUS', 'public/upload/produk-layanan/20230515141320cover kredit website-03.png', 'mulus', 'MULTI LANCAR USAHA adalah kredit yang diperuntukkan sektor usaha produktif non pertanian. Yang berhak memperoleh Kredit Multi Lancar Usaha (MULUS) adalah Penduduk Jawa Timur yang mempunyai sektor usaha produktif non pertanian.', , '2021-07-28 12:21:51', '2023-05-15 14:13:20'),
(11, 2, 'DAGULIR', 'public/upload/produk-layanan/20210728192242DAGULIR_2018-11-01_08_34_55.jpg', 'dagulir', 'Kredit DAGULIR Merupakan Program Kredit pada Bank BPR Jatim-Bank UMKM Jawa Timur yang Bersumber Dari APBD Provinsi Jawa Timur yang Diperuntukkan Bagi Usaha Mikro, Kecil, Menengah dan Koperasi di Jawa Timur.', , '2021-07-28 12:22:42', '2023-02-08 13:54:33'),
(12, 2, 'PKPJ', 'public/upload/produk-layanan/20230515141203cover kredit website-02.png', 'pkpj', 'Paket Kredit Petani Jawa Timur (PKPJ) adalah fasilitas kredit yang diberikan kepada petani perorangan/kelompok tani/koperasi yang mempunyai kegiatan usaha dibidang pertanian, peternakan, perikanan, dan perkebunan.', , '2021-07-28 12:23:22', '2023-05-15 14:12:03'),
(13, 2, 'KUIPS', 'public/upload/produk-layanan/20210728192403KUIPS_2018-11-01_09_27_11.jpg', 'kuips', 'Kredit Usaha Industri Primer dan/ atau Sekunder (KUIP/S) adalah kredit yang diperuntukkan bagi usaha yang bergerak pada kegiatan pengolahan pertama dan/ atau kegiatan pengolahan tahap kedua dari hasil produksi sektor industri primer (hasil pertanian, perkebunan, perikanan & kelautan, kehutanan, peternakan, dan pertambangan);', , '2021-07-28 12:24:03', '2021-07-28 12:24:03'),
(14, 2, 'HIPPAMS', 'public/upload/produk-layanan/20230515084951cover kredit website-08.png', 'hippams', 'Hippams adalah Himpunan Penduduk Pemakai Air Minum dan Sanitasi.', , '2021-07-28 12:24:51', '2023-05-15 08:49:52'),
(15, 3, 'ATM', 'public/upload/produk-layanan/20230220141000DSC04553.jpg', 'atm', 'Bank Perkeditan Rakyat Jawa Timur telah memiliki ijin sebagai penerbit Kartu ATM berdasarkan surat Bank Indonesia Nomor: 15/ 24/ DASP tanggal 18 Januari 2013 tentang Permohonan Izin Penerbitan Kartu ATM.', , '2021-07-28 12:30:49', '2023-02-20 14:10:01'),
(16, 3, 'MOBIL KAS', 'public/upload/produk-layanan/20230216094328mobil kas 2.png', 'mobil-kas', 'Mobil Kas Keliling adalah salah satu fasilitas unggulan dari Bank BPR Jatim, berupa armada mobil kas yang memiliki berbagai macam fasilitas bagi nasabah Bank BPR Jatim, diantaranya:', , '2021-07-28 12:32:59', '2023-02-16 09:43:28'),
(17, 3, 'MONEY CHANGER', 'public/upload/produk-layanan/20210728193347k71lcdya6enwpfpl42sa.jpg', 'money-changer', 'Fasilitas layanan Bank BPR Jatim Bank UMKM Jawa Timur dalam memberikan pelayanan kepada nasabah untuk melakukan transaksi jual beli mata uang asing.', , '2021-07-28 12:33:47', '2021-07-28 12:33:47'),
(18, 3, 'UMKM GO', 'public/upload/produk-layanan/20230208141208WhatsApp Image 2023-02-08 at 14.08.09.jpeg', 'umkm-go', 'Fasilitas layanan Bank BPR Jatim Bank UMKM Jawa Timur berbasis Online', , '2021-07-28 12:36:25', '2023-02-08 14:12:08'),
(19, 2, 'PROKESRA', 'public/upload/produk-layanan/20230515111239cover kredit website-01.png', 'prokesra', 'PROKESRA Program Kesejahteraan Masyarakat', , '2023-02-08 14:15:10', '2023-05-15 14:06:12'),
(21, 2, 'KREDIT MULTIGUNA', 'public/upload/produk-layanan/20230216104423Hijau Toska Profesional Inisial Logo.png', 'kredit-multiguna', '.', 0x3c703e2e3c2f703e, '2023-02-16 10:44:23', '2023-03-06 11:38:55'),
(22, 2, 'KREDIT KENDARAAN BERMOTOR', 'public/upload/produk-layanan/20230515084331cover kredit website-07.png', 'kredit-kendaraan-bermotor', 'KKB (KREDIT KENDARAAN BERMOTOR)', , '2023-02-16 10:45:38', '2023-07-26 02:23:02'),
(23, 2, 'KREDIT UMROH', 'public/upload/produk-layanan/20230515091321cover kredit website-06.png', 'kredit-umroh', 'Kredir Talangan Umroh Merupakan salah satu produk kredit dengan jangka waktu 3 tahun dengan suku bunga 9% PA FLAT', , '2023-02-16 10:45:57', '2023-05-15 10:29:16'),
