INSERT INTO `kebijakan_privasi` (`id`, `kebijakan_privasi`, `created_at`, `updated_at`) VALUES
(1, '<p><strong>Privasi Anda penting bagi kami</strong><br />\r\n        Dalam kebijakan ini, &ldquo;kami&rdquo;, &ldquo;kita&rdquo; atau &ldquo;BPR Jatim&rdquo; adalah PT Bank Perkreditan Rakyat Jawa Timur, &ldquo;Anda&rdquo; adalah semua nasabah, pengunjung dan pengguna situs PT Bank Perkreditan Rakyat Jawa Timur dan kepada siapa kebijakan ini berlaku, beserta perusahaan yang terkait, afiliasi, dan cabang.<br />\r\n        <br />\r\n        Keamanan terhadap data pribadi Anda penting bagi kami. PT Bank Perkreditan Rakyat Jawa Timur melindungi data pribadi yang tersimpan dengan kami. Kebijakan ini menjelaskan bagaimana kita dapat mengumpulkan, menggunakan, mengungkapkan, proses dan mengelola data pribadi Anda.</p>\r\n        \r\n        <p>Kebijakan ini berlaku untuk data pribadi setiap individu yang kami miliki atau dibawah kendali kami.</p>\r\n        \r\n        <p><strong>Data pribadi apa saja yang kami kumpulkan</strong><br />\r\n        &ldquo;Data pribadi&rdquo; adalah data yang dapat digunakan untuk mengidentifikasi orang perorangan. Beberapa contoh data pribadi yang dapat kami kumpulkan adalah:<br />\r\n        (a) data pribadi (misal : nama, rincian kontak, alamat rumah, tanggal lahir, KTP/Paspor, dan/atau pendidikan);<br />\r\n        (b) specimen tanda tangan;<br />\r\n        (c) rincian keuangan (misal : pendapatan, pengeluaran, dan/atau riwayat kredit);<br />\r\n        (d) gambar dan rekaman suara percakapan Anda dengan kami;<br />\r\n        (e) rincian kerja (misal: pekerjaan, direktur dan posisi lain yang dimiliki, riwayat pekerjaan, gaji, dan/atau manfaat);<br />\r\n        (f) pajak dan informasi asuransi;<br />\r\n        (g) informasi tentang profil risiko, investasi, tujuan investasi, pengetahuan dan pengalaman dan/atau kepentingan bisnis dan aset;<br />\r\n        (h) informasi perbankan (misal : nomor rekening dan transaksi perbankan); dan/atau<br />\r\n        (i) pendapat pribadiyang diberitahukan kepada kami (misal : umpan balik atau tanggapan terhadap survei);</p>\r\n        \r\n        <p><strong>Penggunaan data Pribadi Anda</strong><br />\r\n        Kami dapat menggunakan data pribadi Anda untuk tujuan bisnis inti kami, seperti:<br />\r\n        (a) mengembangkan dan menyediakan fasilitas perbankan, produk atau jasa (baik yang disediakan oleh kami atau melalui kami), termasuk namun tidak terbatas pada:<br />\r\n        i. melaksanakan investasi, perbankan, transaksi komersial atau lainnya dan kliring atau melaporkan transaksi tersebut;<br />\r\n        ii. melaksanakan penelitian, perencanaan dan analisis statistik; atau<br />\r\n        iii. analisis untuk tujuan mengembangkan atau memperbaiki produk, layanan, keamanan, kualitas layanan, dan iklan strategi;<br />\r\n        (b) melakukan penilaian dan memproses aplikasi, instruksi atau permintaan dari Anda atau nasabah kami;<br />\r\n        (c) berkomunikasi dengan Anda, termasuk menyediakan Anda mengenai pembaharuan produk, layanan dan fasilitas perbankan (baik yang disediakan oleh kami atau melalui kami) termasuk setiap penambahan, perluasan, suspensi dan penggantian untuk produk tersebut, layanan dan fasilitas perbankan dan istilah mereka dan kondisi;<br />\r\n        (d) mengelola infrastruktur dan operasi bisnis kami dan sesuai dengan kebijakan dan prosedur internal;<br />\r\n        (e) menanggapi pertanyaan atau umpan balik;<br />\r\n        (f) menangani atau menyelidiki keluhan, klaim atau sengketa;<br />\r\n        (g) memverifikasi identitas Anda untuk tujuan penyediaan fasilitas perbankan, produk atau jasa;<br />\r\n        (h) melakukan pemeriksaan kredit, pemutaran atau cek uji tuntas yang mungkin diperlukan menurut hukum yang berlaku, peraturan atau kebijakan;<br />\r\n        (i) mematuhi semua hukum yang berlaku, peraturan, aturan, arahan, perintah, instruksi dan permintaan dari setiap otoritas lokal atau asing, termasuk regulasi, pemerintah, pajak, dan pejabat penegak hukum atau pihak berwenang lainnya;<br />\r\n        (j) menegakkan kewajiban yang terhutang kepada kami;<br />\r\n        (k) mengawasi produk dan layanan yang disediakan oleh atau tersedia melalui kita;<br />\r\n        (l) memenuhi kewajiban dan persyaratan yang dikenakan oleh kami dari waktu ke waktu oleh biro kredit atau layanan berbagi informasi kredit dimana kita adalah anggota atau terdaftar;<br />\r\n        (m) menciptakan dan memelihara kredit dan model risiko yang terkait;<br />\r\n        (n) pelaporan keuangan, pelaporan peraturan, pelaporan manajemen, manajemen risiko (termasuk eksposur kredit pengawasan), audit dan pencatatan;<br />\r\n        (o) memungkinkan penerima pengalihan sebenarnya atau yang diusulkan atau pengalihan, peserta atau sub-peserta hak atau kewajiban DBS untuk mengevaluasi setiap transaksi yang diusulkan;<br />\r\n        (p) menegakkan kewajiban yang terhutang kepada kami; dan / atau<br />\r\n        (q) mencari nasihat profesional, termasuk nasihat hukum.</p>\r\n        \r\n        <p>Kami juga dapat menggunakan data pribadi untuk tujuan yang ditetapkan dalam syarat dan ketentuan yang mengatur hubungan kita dengan Anda atau pelanggan kami.</p>\r\n        \r\n        <p><strong>Penggunaan data pribadi untuk tujuan pemasaran</strong></p>\r\n        \r\n        <p>Kami dapat menggunakan data pribadi Anda untuk menawarkan produk atau jasa, termasuk penawaran khusus, promosi, kontes atau informasi yang mungkin menarik bagi Anda atau mungkin memenuhi persyaratan. Pesan pemasaran tersebut dapat dikirim kepada Anda dalam berbagai cara termasuk tetapi tidak terbatas pada surat elektronik, mailer langsung, layanan pesan singkat, telepon, faksimili dan layanan mobile messaging lainnya. Dengan demikian, kita akan mematuhi Bank Indonesia / Otoritas Jasa Keuangan dan undang-undang perlindungan data dan privasi yang berlaku lainnya.</p>\r\n        \r\n        <p>Dalam hal pengiriman pesan telemarketing ke nomor telepon Indonesia Anda melalui layanan pesan singkat, telepon, faksimili dan layanan pesan mobile lainnya, yakinlah bahwa kita hanya akan melakukannya jika kita memiliki persetujuan yang jelas dan tidak ambigu dari Anda secara tertulis atau bentuk rekaman lainnya untuk melakukannya atau jika Anda belum dinyatakan membuat pendaftaran dalam Daftar Tidak Ingin Ditelpon.</p>\r\n        \r\n        <p>Anda dapat membuat permohonan setiap saat untuk kami supaya berhenti menghubungi Anda untuk tujuan pemasaran via dipilih atau semua mode.Tidak ada dalam pasal ini harus bervariasi atau mengubah syarat dan ketentuan yang mengatur hubungan kami dengan Anda.</p>\r\n        \r\n        <p><strong>Pengungkapan dan berbagi data pribadi</strong></p>\r\n        \r\n        <p>Kami mungkin dari waktu ke waktu dan sesuai dengan semua hukum yang berlaku pada privasi data, mengungkapkan data pribadi Anda kepada setiap personil dari PT Bank Perkreditan Rakyat Jawa Timur atau pihak ketiga, baik yang berada di Indonesia atau di tempat lain, dalam rangka untuk melaksanakan tujuan yang ditetapkan di atas. Percayalah bahwa ketika kami mengungkapkan data pribadi Anda kepada pihak tersebut, kami meminta mereka untuk memastikan bahwa setiap data pribadi diungkapkan kepada mereka yang dirahasiakan dan aman.</p>\r\n        \r\n        <p>Untuk informasi lebih lanjut tentang pihak ketiga dengan siapa kami berbagi data pribadi Anda, Anda mungkin, bila sesuai, ingin merujuk perjanjian dan / atau syarat dan ketentuan yang mengatur hubungan kami dengan Anda atau pelanggan kami. Anda juga dapat menghubungi kami untuk informasi lebih lanjut (silakan lihat &quot;Bagaimana untuk menghubungi kami&quot; di bawah).Kami ingin menekankan bahwa PT Bank Perkreditan Rakyat Jawa Timur tidak menjual data pribadi kepada pihak ketiga dan kami akan tetap sepenuhnya kompatibel dari setiap tugas atau kewajiban untuk menjaga kerahasiaan dikenakan pada kami di bawah perjanjian yang berlaku dan / atau syarat dan ketentuan yang mengatur hubungan kami dengan Anda atau pelanggan kami atau hukum yang berlaku.<br />\r\n        Kami dapat mentransfer, menyimpan, mengolah, dan / atau berurusan dengan data pribadi Anda di luar Indonesia. Dengan demikian, kami akan mematuhi Bank Indonesia / Otoritas Jasa Keuangan dan hukum perlindungan data dan privasi yang berlaku lainnya.</p>\r\n        \r\n        <p><strong>Retensi data pribadi.</strong><br />\r\n        Data pribadi Anda akan dipertahankan selama tujuan yang dikumpulkan tetap dan sampai tidak lagi diperlukan untuk tujuan hukum atau bisnis lainnya.</p>\r\n        \r\n        <p><strong>Akses dan koreksi</strong><br />\r\n        Anda dapat meminta akses atau melakukan koreksi terhadap data pribadi Anda dipegang oleh PT Bank Perkreditan Rakyat Jawa Timur. PT Bank Perkreditan Rakyat Jawa Timur dapat mengenakan biaya untuk memproses permintaan Anda untuk akses. Biaya tersebut tergantung pada sifat dan kompleksitas permintaan akses Anda. Kami akan memberitahu Anda biaya sebelumnya dan mengambil instruksi lebih lanjut sebelum dibebankan kepada Anda.</p>\r\n        \r\n        <p><strong>Bagaimana menghubungi kami</strong><br />\r\n        Untuk menghubungi kami pada setiap aspek kebijakan ini atau data pribadi Anda atau memberikan umpan balik yang mungkin Anda miliki, silakan kunjungi cabang kami atau menghubungi petugas di kantor cabang terdekat.<br />\r\n        <br />\r\n        <strong>Perubahan dan update dari PT Bank Perkreditan Rakyat Jawa Timur Kebijakan Privasi</strong><br />\r\n        Kami dapat mengubah kebijakan ini dari waktu ke waktu untuk memastikan bahwa kebijakan ini konsisten dengan setiap perkembangan dengan cara PT Bank Perkreditan Rakyat Jawa Timur menggunakan data pribadi Anda atau perubahan pada undang-undang dan peraturan yang berlaku di PT Bank Perkreditan Rakyat Jawa Timur. Kami akan menyediakan kebijakan diperbaharui di situs web kami dan pada cabang-cabang kami. Semua komunikasi, transaksi dan transaksi dengan kami harus tunduk pada versi terbaru dari kebijakan ini berlaku pada saat itu.</p>', '2021-07-27 14:11:20', '2021-07-27 14:11:20');

