(17, 14, 'Hani Nizar Alfaniar', 'Nganjuk', '1997-05-21', 'Laki-laki', 'KTP', '3518132105970003', 'Jalan Lurah Surodarmo III No. 28', '081233908247', '', '', '7999550143020495', 'Hani Nizar Alfaniar', 'Nganjuk', '1997-05-21', 'Laki-laki', 'KTP', '3518132105970003', 'Jalan Lurah Surodarmo III No. 28', '081233908247', '', '', 'Kredit', 'Tidak bisa di stor/transfer dari bank lain\nTidak tahu kode bank nya', '2022-11-30 22:58:59', '2022-11-30 22:58:59'),
(22, 14, 'Amalisa Yuristasari', 'Nganjuk', '1992-03-28', 'Perempuan', 'Ktp', '3518136803920001', 'Jl.citarum 2 no 34 begadung nganjuk', '0857', '0746', '3359', '0143022935', 'Amalisa yuristasari', 'Nganjuk', '1992-03-28', 'Perempuan', 'Ktp', '3518136803920001', 'Jl.citarum 2 no 34 begadung nganjuk', '0857', '0746', '3359', 'ATM', 'ATM terblokir. Lupa kata sandi', '2023-04-19 19:06:22', '2023-04-19 19:06:22'),
(23, 9, 'Suyati', 'Ngawi', '1971-08-28', 'Perempuan', 'KTP', '3521036808710001', 'RT/RW 001/002 Kembang Sore, Talang, Jogorogo, Ngawi', '-', '082336950610', '-', '0090011197', 'Clarina Yosi Pratiwi', 'Ngawi', '2002-03-09', 'Perempuan', 'KTP', '3521034903020003', 'RT/RW 001/002 Kembang Sore, Talang, Jogorogo, Ngawi', '-', '085784520398', '-', 'Tabungan', 'Saya Clarina, anak dari Ibu Suyati nasabah Bank BPR Jatim. Saya akan membuat visa dan salah satu dokumen yang diperlukan adalah rekening koran orang tua. Kemarin ibu saya sudah bertanya ke kantor cabang BPR Jatim di kecamatan Jogorogo, tetapi petugas bank memberitahukan bahwa pihak bank tidak bisa membuatkan rekening koran karena katanya kebijakan tersebut sudah dihapus dari pusat. Apakah benar demikiann?\n\nSaya sangat membutuhkan dokumen rekening koran tersebut untuk keperluan visa saya jadi saya mohon bantuan pihak bank BPR Jatim dapat membuatkan dokumen tersebut. Terimakasih.', '2023-05-20 18:59:19', '2023-05-20 18:59:19'),
(24, 9, 'Tjoa Kian Tiong', 'Madiun', '1957-12-12', 'Laki-laki', 'Ktp', '3577011212570001', 'Jln raya dungus dsn watutumpeng rt03 rw01 Wungu Madiun', '0813', '3678', '9110', '0101023826', 'Tjoa Kian Tiong', 'Madiun', '1957-12-12', 'Laki-laki', 'Ktp', '3577011212570001', 'Raya dungus dsn watutumpeng rt03 rw01 Karangrejo Wungu Madiun', '0813', '3678', '9110', 'Kredit', 'Janji dari pimpinan kredit yg tdk direalisasikan dan pimpinan bank jatim ngawi serta pimpinan bag kredit lepas tanggung jawab.mksh', '2023-08-18 00:36:59', '2023-08-18 00:36:59'),
(25, 9, 'Jujuk widodo', 'Ngawi', '1982-01-30', 'Laki-laki', 'Ktp', '3521033001820002', 'Dawungrejo rt05,rw 01,desa dawung,kecamatan jogorogo,kabupaten ngawi,provonsi jawa timur', '085853806003', '085853806003', '085853806003', '0090020617', 'Jujuk widodo', 'Ngawi', '1982-01-30', 'Laki-laki', 'Ktp', '3521033001820002', 'Dawungrejo rt05,rw 01,desa dawung,kecamatan jogorogo,ngawi ,jawa timuf', '085853806003', '085853806003', '085853806003', 'Kredit', 'Saya mempunyai kredit di bank umkm yang untuk agunannya atau jaminannya sertifikat tanah ,kredit sudah saya selesaikan/lunasi  di bulan maret 2023, tetapi sampai hari ini 24 agustus 2023 ,sertifikat atau jaminannya belum keluar,saya sudah 3 kali ke bank menanyakan sertifikat tidak ada respon,\nMohon tindakan,atau sarannya agar sertifikat bisa keluar,terimakasih', '2023-08-24 10:16:02', '2023-08-24 10:16:02'),
(26, 23, 'KULTUM', 'SIDAORJO', '1965-08-14', 'Perempuan', '-', '-', 'CANGKRING MALANG TENGAH RT001 RW002 BEJI KABUPATEN PASURUAN', '085790835214', '085790835214', '085790835214', '-', 'ASWADUN NAKIRIN (ANAK IBU KULTUM)', 'SIDOARJO', '1990-07-07', 'Laki-laki', '3514130706920001', 'KTP', 'CANGKRING MALANG TENGAH RT001 RW002 BEJI KABUPATEN PASURUAN', '085746648171', '085746648171', '085746648171', 'Lainnya', 'Saya mewakili Ibu saya, dimana ibu saya selaku nasabah meninggal dunia di bulan february 2023, sejak saat itu kami pihak keluarga melaporkan ke bank dan sampai terakhir document sudah komplit. namun di bulan Mei / Juni informasi bahwa belum selesai karena asuransi dan saya diminta untuk meminjami uang 1x angsuran dan sudah kami serahkan karena kata nya biar masalah jaminan sertifikat cepat keluar, alhasil sampai akhir bulan september 2023 tidak ada jawaban yang melegakan hati keluarga, sampai kami telepon orang asuransi kata nya sudah tidak ada kendala. mohon untuk di perhatikan kami keluarga nasabah bukan hanya menunggu kepastian jaminan karena sudah terlalu lama di ombang ambingkan tanpa kejelasan, kami juga butuh progress atas alasan \" problem asuransi\". terimakasih. ini nomor Pak Dody kepala cabang yang menangani (089518105033)', '2023-09-29 08:10:41', '2023-09-29 08:10:41'),
(27, 19, 'Sumaiyah', 'Gresik', '1985-09-05', 'Perempuan', 'Sertifikat', '6472080807950001', 'Desa banter, kecamatan benjeng', '08', '0822527361826', '08', '7999550192007615', 'Afif Zamroni', 'Gresik', '1995-08-08', 'Laki-laki', 'Sertifikat', 'Tanah', 'Desa Ngasin Dusun Genengan', '08', '082154678954', '08', 'Kredit', 'Bagaimana ibu saya mau pengajuan ulang program prokersa tapi di persulit padahal track record pembayaran sangat bagus, tolong diperbaiki lagi, padahal menawarkan sendiri real ulang tapi tidak bisa diproses dengan segala alasan yang tidak jelas, dan diterima nalar, cabang Gresik cerme tolong disidak.', '2023-09-30 19:25:30', '2023-09-30 19:25:30');

